EMENDA  MODIFICATIVA


O art.4º do  projeto de Lei 4.372 de 2012 passa a ter a seguinte redação: 



Capítulo III  
Da estrutura básica e direção.


Art. 4o O INSAES será dirigido por um Presidente e até seis Diretores, e disporá, em sua estrutura regimental, de um Conselho Superior.

§ 1º O Presidente do INSAES será indicado pelo Ministro da Educação dentre profissionais da área de educação, com reconhecida competência a ser aferida mediante sabatina junto à Comissão de Educação do Senado Federal para posterior nomeação pelo Presidente da República para mandato de 04 (quatro) anos permitida uma recondução;

§ 2º As Diretorias referidas no caput são as seguintes:
A - Diretoria de Avaliação da Educação Superior;
b - Diretoria de Administração e Finanças;
c - Diretoria de Tecnologia e Informação;
d - Diretoria da Regulação da Educação Superior;
E - Diretoria de Supervisão da Educação Superior;
f - Diretoria de Certificação de Entidades Beneficentes de Assistência Social.

Parágrafo Único - As Diretorias São cargos Técnicos e de confiança a serem nomeados pelo Presidente do INSAES  com aprovação do Conselho Superior.

             3º. O Conselho Superior, órgão técnico, recursal e de assessoramento à Presidência do INSAES,  será composto por 12 (doze) membros, para mandato de 04 (quatro) anos.

